// board_reduer에서 받아온 데이터를 사용하기

const BoardList = () => {
  return (
    <div>
      <h3 className="text-center">게시판 목록</h3>
      <table className="table table-striped" style={{ marginTop: 20 }}>
        <colgroup>
          <col width="8%" />
          <col width="*" />
          <col width="12%" />
          <col width="12%" />
        </colgroup>

        <thead>
          <th>번호</th>
          <th>제목</th>
          <th>작성자</th>
          <th>조회수</th>
        </thead>
      </table>
    </div>
  );
};

export default BoardList;
